import logo from "./revslogo.png";

function HomePage(props) {

    var backgroundStyle = {
        width: "100%",
        height: "400px",
        backgroundImage: `url(${logo})`
    }

    return (

        <div style={backgroundStyle}>
            Welcome To Revs
        </div>

    )
}

export default HomePage;
